import React,{Component} from 'react';
import L from 'leaflet';




class Map2 extends Component{
    componentDidMount(){
        this.map=L.Bounds('map',{
            center:[36,9],
            zoom:6,
            zoomControl:false
        })
        L.tileLayer('https://{s}.tile.openstreetmap.org/{z}/{x}/{y}.png',
        {
            detectRetina:true,
            maxZoom:20,
            maxNativeZoom:17
        }).addTo(this.map)
    }
    render(){
        return <div width="1200px" height="720" id="map"/>
    }
}
export default Map2;
